pe\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":8.346709470304976,\"y\":66.5840179332955,\"width\":15.519662921348313,\"height\":7.609602049519485,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Building Food</strong></p>\\n\"},\"subContentId\":\"35c50975-b07c-4522-9664-a58ccd0e1505\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":37.7207062600321,\"y\":66.26695118123219,\"width\":15.519662921348313,\"height\":7.609602049519485,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Energy Food</strong></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a42b7d56-d2f8-4dba-9d1a-e026a684eb96\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":32.58426966292134,\"y\":72.92535297456173,\"width\":27.28731942215088,\"height\":25.360393923732758,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.6875em\\\">Foods rich in carbohydrates or lipids are energy food. Carbohydrates are digested in the body into glucose, which is the main source of energy in the body.</span></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8ab7ca04-3daf-4661-928a-f65627c309fa\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":73.35473515248796,\"y\":65.63281767710555,\"width\":15.519662921348313,\"height\":7.609602049519485,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Functional Food</strong></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1013b0ce-71bc-4a52-b89a-3c9b04864e72\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":62.43980738362761,\"y\":70.37391682070826,\"width\":37.557624398073834,\"height\":28.53106144436588,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.6875em\\\">Foods rich in water, mineral salts and vitamins are functional food. Water is involved in different intracellular reactions (hydrolysis), and it transports different substances. It also contributes to maintaining a constant body temperature. Vitamins are needed to stay healthy and fight diseases. Minerals are needed for blood, bones, muscles and teeth. </span></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"2c6d5bee-5df9-4f97-81a4-fc832433c0b6\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":3.0497592295345104,\"y\":59.608549387902634,\"width\":40.123434991974314,\"height\":28.536007685698067,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"shape\":{\"fillColor\":\"rgb(245, 245, 245)\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\",\"borderColor\":\"rgb(0, 158, 140)\",\"borderRadius\":\"3\"},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"subContentId\":\"6ea17e9d-cb50-41c4-814e-66caf5fb0c9d\",\"metadata\":{\"contentType\":\"Shapes\",\"license\":\"U\"}},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":30.818619582664525,\"y\":1.9024005123798713,\"width\":39.99807383627608,\"height\":9.507056320567168,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3 style=\\\"text-align:center\\\"><strong><span style=\\\"color:#009e8c\\\">Energy Supply</span></strong></h3>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"491bdefd-5465-4fdf-aae9-c3e76f457e47\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":3.210272873194221,\"y\":12.672777599868098,\"width\":89.8876404494382,\"height\":47.56001280949678,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Food is the fuel that gives us energy. </p>\\n\\n<p>A body in motion capable of doing work is said to have energy. Energy is expressed in Joules (J) in SI or calories.</p>\\n\\n<p>As a guide, an average man needs around 2,500 kcal (10,500 kJ) a day to maintain a healthy body weight. <br />\\nFor an average woman, that figure is around 2,000 kcal (8,400 kJ) a day. <br />\\nThese values can vary depending on age, sex, physiological state, activity and climate.<br />\\n </p>\\n\"},\"subContentId\":\"90766ce1-c2b1-4a85-8a21-ba793a0edba6\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":4.654895666131621,\"y\":61.510949900282505,\"width\":36.91813804173354,\"height\":25.36534016506495,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>In general,</strong></p>\\n\\n<p>•    1 g of carbohydrates \\\\(\\\\rightarrow\\\\) 17 kJ of energy<br />\\n•    1 g of proteins \\\\(\\\\rightarrow\\\\) 17 kJ of energy<br />\\n•    1 g of lipids \\\\(\\\\rightarrow\\\\) 38 kJ of energy</p>\\n\\n<p> </p>\\n\"},\"subContentId\":\"46f17d40-cf0f-48d2-98e5-249d12618dbb\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":57.78491171749598,\"y\":51.36481383425652,\"width\":33.79309791332263,\"height\":34.87734272696431,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA04AAAG6CAIAAACwXoHwAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAP+lSURBVHhe7J0HgBXVvf/PtNu29wpLWXrvoNJREWzYNfao0fcS8zea+FJ8z5dmmj6TaDSxJLFiF1AUFQEB6b2zC8v23ve2uVP+35nfZbzuAmKisizn43r4nd8pc2bO3Pl977QrmKbJOBwOh8PhcDg9ETH6L4fD4XA4HA6nx8GlHofD4XA4HE6PhUs9DofD4XA4nB4Ll3ocDofD4XA4PRYu9TgcDofD4XB6LFzqcTgcDofD4fRYuNTjcDgcDofD6bHw9+pxeixd921BEKIWp4dy4gPa8XYAwzCi1lFEkX8N5nA4PQQu9Tg9Ftq3kSJsO/t5bLCHk4u/HoYz6TSzSMkDIxKJhMNhqDrJRtM02IqiuN1u2kOoJlUGZHM4HM7pDpd6nB4C7clIEaSROsGbYjYFeGSpjiP+eETvYdC0AswsxBxSzDt5amtrt2zZggo+n0+W5aamJoi/fv36jR07lioQuq5j9+i0Y6AV31U4HM5pCpd6nB6CI91gIFojwDuxmS7PIaXATzVJ/NnlnJ4DaTJMLs0v7Q9QdaFQ6PDhw8XFxZBxbrc7LS0tMTERRYqi5ObmBoPB5ORkeCAB0RD9oBp1yOFwOKc7XOpxeg7YmSHyEK0p3ke9R6EQDhDFyUadrtU4pzWYekwuzSyAZ+fOna+88sqePXsaGhqam5tVVc3IyIDUGzhw4MSJE3v16gXlFwgE0tPT8/Pz4+Li0MRpC465L3E4HM5pBJd6nJ6AcyYGBp2PQfDesWNHXV1dv379hg8fjmiNXd0J26QGqAlSTs8A84uZlSSJdoPa2toPP/zwmWeeWb9+fSgUilY6Cr4SjBo16rLLLps8ebKiKGiVmprq8/no9F60ko2z23A4HM7pCJd6nJ4AST2AAN/U1PTCCy+8+u roundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":52.00642054574639,\"y\":85.92508980915751,\"width\":44.81348314606741,\"height\":9.507056320567168,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.6875em\\\">When we consume more calories than we expand, our bodies store the excess as body fat. If this continues over time, we may put on body mass.</span></p>\\n\"},\"subContentId\":\"3ab80d6c-8ffc-4a64-ac4d-78bf9096faae\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":3.210272873194221,\"y\":12.682670082532475,\"width\":94.70304975922953,\"height\":44.38934528886366,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>A food ration must cover the minimum food needs of an individual both quantitatively and qualitatively, to ensure the continuity of their vital functions (respiration, cardiac activity and gland activity) and their complementary needs. </p>\\n\\n<p>Our bodies use up that energy through everyday movement, which includes everything from breathing to running. To maintain a stable body mass, the energy we put into our bodies must be the same as the energy we use by normal bodily functions and physical activity. An important part of a healthy diet is balancing the energy we put into our bodies with the energy we use. For example, the more physical activity we do, the more energy we use.</p>\\n\"},\"subContentId\":\"c2e88df9-8e05-43cf-a45e-88697a6da4e4\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":fa ackgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":28.89245585874799,\"y\":1.2682670082532475,\"width\":39.99807383627608,\"height\":9.507056320567168,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3 style=\\\"text-align:center\\\"><span style=\\\"color:#009e8c\\\">Balanced Diet</span></h3>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"e708ede7-dbcd-4666-947a-9bb8d15236a0\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.6051364365971106,\"y\":9.502110079234981,\"width\":97.91332263242374,\"height\":22.19467264443183,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>A balanced diet should satisfy all the qualitative and quantitative needs of an organism. This means that the food ration should contain energy foods: carbohydrates and lipids, building foods: proteins of animal and plant origin, and functional foods: water, mineral salts and vitamins according to the required amount. The total provided energy should not exceed or be less than the daily energy needs of an individual.<br />\\n </p>\\n\"},\"subContentId\":\"74ed344b-d772-4d6d-8832-93a4638399fc\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":53.29052969502408,\"y\":48.51121306568672,\"width\":39.99807383627608,\"height\":31.706675206331187,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>3 balanced diets must be consumed daily.</p>\\n\\n<ul>\\n\\t<li>Breakfast (20 to 25 %)</l 77087488228,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Marasmus</strong></p>\\n\"},\"subContentId\":\"edd78148-fe02-4915-8ca2-142c515c5449\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":40.12841091492776,\"y\":76.09602049519485,\"width\":16.051364365971107,\"height\":7.609602049519485,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Kwashiorkor</strong></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"203ada4e-427a-4aa0-8325-3577bbe16fc3\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":35.313001605136435,\"y\":80.85202177614453,\"width\":30.497592295345104,\"height\":19.019058882466524,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.5em\\\">This disease is caused by inadequate protein intake. Food quantity may be sufficient, but the diet is unbalanced. Children with this disease have abnormal growth, protuberant abdomen and suffer from edema.</span></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b741980a-daa0-41f9-a734-a2edbca62631\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":68.91634980988593,\"y\":74.82689825137895,\"width\":30.59648288973384,\"height\":25.161366036850133,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.5em\\\">The lack or deficiency of one or more of these vitamins may have bad effects on the body. Rickets is a bone disease which causes deformation of the skeleton, mainly characterized by arched legs. Rickets is due to deficiency in vitamin D that is necessary for the fixation of calcium in bones. Lack of calcium and vitamin D in adults may lead to osteoporosis.</span></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7196a53b-83d7-4f2d-8a27-e8f8950646ed\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":75.4414125200642,\"y\":71.02295246218186,\"width\":16.051364365971107,\"height\":7.609602049519485,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p style=\\\"text-align:center\\\"><strong>Hypovitaminoses</strong></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8f0967aa-1ec7-46e8-94f8-0521f363727f\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":36.2760834670947,\"y\":64.68161742091561,\"width\":24.23756019261637,\"height\":34.86751365765034,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"shape\":{\"fillColor\":\"rgb(245, 245, 245)\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\",\"borderColor\":\"rgb(0, 158, 140)\",\"borderRadius\":\"3\"},\"type\":\"rectangle\",\"line\":{\"borderColor\":\"#000000\",\"borderWidth\":\"1\",\"borderStyle\":\"solid\"}},\"metadata\":{\"contentType\":\"Shapes\",\"license\":\"U\"},\"subCont ter and minerals (67%) than lamb (41%).</p>\\n\\n<p>2. In case of overweight, chicken meat is recommended because it contains less lipids than lamb. Excess lipids are stored in the body in the form of fats.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"470af9d4-d01f-4b51-984d-0f6af324f3d4\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answers\"},\"subContentId\":\"bdf626d1-6336-4901-958c-36e9cf823139\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"1d6c31d4-4a80-432a-835b-328cf8311a78\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Exercise 5: Healthy Diets</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"e98d5ddf-895d-4478-89ec-580d083d7b4c\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Below are four different meals.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"63352185-fac9-4cf5-abaa-2e648448ec8f\"},{\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQEAYABgAAD/4STURXhpZgAATU0AKgAAAAgABgALAAIAAAAmAAAIYgESAAMAA pted for a young swimmer. Justify.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"f07a5599-5690-4ea2-bbd5-20f18d822093\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2. Which meal is convenient for a pregnant woman? Justify.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"a10719f4-ebcc-4a60-9544-0838768e7685\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3. Which is the best meal for a sedentary adult? Justify.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"143f861d-3906-4820-9dbb-7f943e64c285\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4. Which meal is to be avoided? Justify.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"1b427ce6-42f4-4f71-a928-4046c764c945\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Questions\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Questions\"},\"subContentId\":\"c173eb0d-a15c-4e9d-8d87-2660177e3750\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. Menu number 4 is best to meet the energy requirements of a young athlete. It is rich in energy nutrients (carbohydrates).</p>\\n\\n<p>2. Menu number 1 is rich in proteins (liver meat), an essential building nutrient for the baby's growth.</p>\\n\\n<p>3. Menu number 2 is best adapted for an adult with low physical activity. Carbohydrates (energy foods) are supplied in moderate quantity.</p>\\n\\n<p>4. Menu number 3 should not be a regular food diet because it is too rich in lipids, that may lead to overweight and obesity.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7cfe2b6a-9993-4448-9501-f5e8b65895e4\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answers\"},\"subContentId\":\"60c82954-1004-45d8-a4d9-d40af1dc9905\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"d75a2f7d-9e66-42e5-b6f2-c5dfced6b2ca\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Exercise 6: Fight against Obesity</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c640dd80-3402-4883-9c32-20dd45c75634\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Obesity, a state characterized by an abnormal or excessive accumulation of body fat, can lead to dangerous consequences on health. Although many factors can affect obesity, yet this latter is mainly due to an energetic imbalance where the energy supply is higher than the energy expenditure. Three individuals A, B and C consult a l. It is composed of diversity of foods, and it covers the proper energy needs of the individual. This should be accompanied by the consumption of reasonable quantities of proteins, lipids, carbohydrates, mineral salts and vitamins. Individual A’s diet is diversified: it contains the 3 groups of food: functional, energy and builders and its energy value is 3645 almost close to 3500KJ which is the energy which should be provided by a food ration. Consequently, the meal is balanced.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9618e9c9-ecde-4a89-9e2a-3aa615ba6d3c\"}]},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answers\"},\"subContentId\":\"27ef8ba2-692c-460f-84a0-ec0856e3c512\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Untitled Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Documentation Tool\"},\"subContentId\":\"5d186d4e-8ab7-4b30-92b0-ca2bfd0c72b5\"},\"useSeparator\":\"disabled\"}]}","library":"H5P.Column 1.16","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Chapter 02 - Nutrition and Health","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.AdvancedText-1.1/text.js?version=1.1.14","/h5p/libraries/H5P.Shape-1.0/js/h5p-shape.js?version=1.0.5","/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/lib
